	@Inject
	public InfluenceDSLGrammarAccess(GrammarProvider grammarProvider,
			TerminalsGrammarAccess gaTerminals) {
		this.grammar = internalFindGrammar(grammarProvider);
		this.gaTerminals = gaTerminals;
		this.pInfluenceModel = new InfluenceModelElements();
		this.pCyberPhysicalPhenomena = new CyberPhysicalPhenomenaElements();
		this.pMultiPhenomenon = new MultiPhenomenonElements();
		this.pSimplePhenomenon = new SimplePhenomenonElements();
		this.pInfluence = new InfluenceElements();
		this.pRequirementSatisfaction = new RequirementSatisfactionElements();
		this.pArtifact = new ArtifactElements();
		this.pEString = new EStringElements();
		this.pSystemResponse = new SystemResponseElements();
		this.pEmergentBehavior = new EmergentBehaviorElements();
	}
	
	protected Grammar internalFindGrammar(GrammarProvider grammarProvider) {
		Grammar grammar = grammarProvider.getGrammar(this);
		while (grammar != null) {
			if ("fr.inria.kairos.influence.InfluenceDSL".equals(grammar.getName())) {
				return grammar;
			}
			List<Grammar> grammars = grammar.getUsedGrammars();
			if (!grammars.isEmpty()) {
				grammar = grammars.iterator().next();
			} else {
				return null;
			}
		}
		return grammar;
	}
	
	@Override
	public Grammar getGrammar() {
		return grammar;
	}
	
	
	public TerminalsGrammarAccess getTerminalsGrammarAccess() {
		return gaTerminals;
	}

	
